import React from "react";
import DateTime from "react-datetime";
import "react-datetime/css/react-datetime.css";
import '../stylesheets/PersonalInfo.css';

function PersonalInfo(props){
   return(
    <div className="personal-info-container">
        <h3>Informaci√≥n Personal</h3>
        <div className="form-box">
            <form  className="info-box">
                <div className="labels-container date-row">
                    <label>Nombre Completo:</label>
                    <br/>
                    <label>Fecha de Nacimiento:</label>
                </div>
                <div className="inputs-container date-row">
                    <input name="name" type="text" placeholder="Escribe tu nombre completo"></input>
                    <br/>
                    <DateTime
                        name="birth-date"
                        inputProps={{ placeholder: "dd/mm/aaaa" }}
                        dateFormat="DD/MM/YYYY"
                        timeFormat={false}
                    />
                    <label htmlFor="birth-date">Lugar de Nacimiento:</label>
                </div>
            </form>
        </div>
    </div>
   );
}

export default PersonalInfo;
